import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <div className="navbar glass">
            <div className="navbar-div-title">
                <a href="/"><h1 className="beige">iCONICQUE</h1></a>
                <p className="tan">the hits, reviewed; for real icons only.</p>
            </div>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/about">WHO ARE WE?</Link>
            </nav>
        </div >
    );
}

export default Navbar;
